import React, { useEffect, useState } from 'react'
import { addDays, startOfDay, format } from 'date-fns'
import { Stashpoint, DateRange } from './Data'

type DraftCart = {
  readonly stashpointId: any
  readonly dateRange: DateRange
  readonly bagCount: number
}

const getInitialDraftCart = (): DraftCart => {
  const initialDateFrom = addDays(startOfDay(new Date()), 1)

  return {
    bagCount: 1,
    dateRange: { from: initialDateFrom, to: addDays(initialDateFrom, 1) },
    stashpointId: undefined,
  }
}

const Home = () => {
  const [stachList, setStachList] = useState<Stashpoint[]>()
  const [cart, setCart] = useState<DraftCart>(getInitialDraftCart)
  useEffect(() => {
    fetch('http://localhost:3000/api/stashpoints')
      .then((res) => res.json())
      .then((response: Stashpoint[]) => {
        console.log(response)
        setStachList(response)
      })
      .catch((err) => console.log(err))
  }, [])

  console.log('cart', cart)
  return (
    <div>
      <h1>Home</h1>
      <br />
      <div>
        <select name=''>
          <option></option>
          {stachList?.map((data) => {
            return (
              <option key={data.id} value={data.id}>
                {data.name}
              </option>
            )
          })}
        </select>
        <input
          type='date'
          className='fromDate'
          min={format(cart.dateRange.from, 'yyyy-MM-dd')}
        />
        <input
          type='date'
          min={format(cart.dateRange.to, 'yyyy-MM-dd')}
          className='toDate'
        />
        <input type='number' />
        <button>Submit</button>
      </div>
    </div>
  )
}

export default Home
